export default [
  {
    title: 'Albert',
    image: require('../assets/pictures/homepage/albert.jpg'),
    list: [
      'Kuća Albert ima 5 apartmana',
      'Svi apartmani opremljeni sa SAT/TV, Klima uređajima, Internet',
      'Balkoni sa pogledom na more',
      'Kuća je udaljena 500m od mora, 1500m od centra Novalje',
      'Gostima je na raspolaganju hacienda sa ljetnom kuhinjom'
    ],
    description: {
      title: 'Ambijent koji će vam odmoriti tijelo i dušu u okruženju maslina i cvijeća.',
      text: [
        'Večernji ugođaj u hacijendi za druženje, ostaviti će na Vas poseban osjećaj zadovoljstva u pripremanju roštilja i ostalih delicija po vašoj želji, te stvoriti raspoloženje za daljnji nastavak zabave u Gradu Novalji i poznatoj plaži Zrće do jutarnjih sati.',
        'Otprilike 10 minuta do samog centra dolazite pješke u središte Grada i punktova koji će vam pružiti ostale ugostiteljske ponude.'
      ]
    }
  },
  {
    title: 'Gordana',
    image: require('../assets/pictures/homepage/gordana.jpg'),
    list: [
      'Kuća Gordana nalazi se direktno na moru, 250m od centra Novalje',
      '1 apartman za 4 osobe',
      'Apartman je opremljen sa klima uređajem i SAT/TV, Internet'
    ],
    description: {
      title: 'Kuću Gordana odlikuje direktni i prekrasni pogled na more i uvalu Novalje, te plažu ispred kuće',
      text: [
        'Apartman Gordana udaljen je svega 5 metra od mora i ima svoj parking.',
        'Ispred kuće prolazi šetnica koja Vas u jednom smjeru vodi preko centra Novalje (Lože) pa sve do plaže Vrtić Novalje, a u drugom prema plaži Babe, jednoj od najljepših pješčanih plaža u Novalji.'
      ]
    }
  }
]
